import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import DatePicker from "react-datepicker";
import datePicker from "./navbar.module.css";

export default function ButtonAppBar({
  setAPODStartDate,
  setAPODEndDate,
  setAPOD,
  startDate,
  endDate,
}) {
  const SelectStartDate = () => {
    const selectNewStartDate = (date) => {
      setAPODStartDate(date);
      setAPOD([]);
    };

    const selectNewEndDate = (date) => {
      setAPODEndDate(date);
      setAPOD([]);
    };

    return (
      <div className="datePicker">
        <DatePicker
          className="datePicker"
          selected={startDate}
          onChange={(date) => selectNewStartDate(date)}
        />
        <DatePicker
          className="datePicker"
          selected={endDate}
          onChange={(date) => selectNewEndDate(date)}
        />
      </div>
    );
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Spacestagram
          </Typography>
          {SelectStartDate()}
        </Toolbar>
      </AppBar>
    </Box>
  );
}
